import React from "react";

import '../App.css';
import '../Styles/Clock.css';


function CountDown() {
  return (
    <div>
      <div className="clock">
        <div className="flex flex-col items-center">
          <button type="button" style={{ fontSize: 65, color:'#b1b2ff' }}>+</button>
          <div className="hour">13</div>
          <button type="button" style={{ fontSize: 65, color:'#b1b2ff' }}>-</button>
        </div>
        <div className="colon flex flex-col justify-center">:</div>

        <div className="flex flex-col items-center">
          <button type="button" style={{ fontSize: 65, color:'#ffb3b3' }}>+</button>
          <div className="minute">55</div>
          <button type="button" style={{ fontSize: 65, color:'#ffb3b3' }}>-</button>
        </div>


        <div className="colon flex flex-col justify-center">:</div>

        <div className="flex flex-col items-center">
          <button type="button" style={{ fontSize: 65, color:'#ECA869' }}>+</button>
          <div className="second">20</div>
          <button type="button" style={{ fontSize: 65, color:'#ECA869' }}>-</button>
        </div>
      </div>

      <Link to="/countdown" className="button" style={{ backgroundColor: "#e27f23" }}>Countdown</Link>
    </div>
  );
}



export default CountDown;
